import './Informacoes.css'


function Informacoes(props){   
    return(
        <div className='informacoes'>
            <h1>Nome: {props.informacoes.name} </h1>
            <h1>Autor(s): {props.informacoes.author} </h1>
            <h1>Topico / assunto: {props.informacoes.topic} </h1>
            <h1>Numero de paginas: {props.informacoes.pageNumber} </h1>
            <h1>Ano de publicação: {props.informacoes.year} </h1>
            <h1>Edição: {props.informacoes.edition} </h1>
            <h1>Local de publiçao: {props.informacoes.publication} </h1>
            <h1>Imagem: {props.informacoes.image} </h1>
        </div>
    )
}
export default Informacoes;
